import React, { Component } from 'react';
import './Section.css';

class Section extends Component {

    // props are :headerText :list of body
    constructor(props) {
        super(props);
      }

    render(){    
        return (
            <div className="right-align">
                <h1>Hi there, I'm Laura</h1>
                <h5 id="thanks-text">Thanks for checking out my portfolio today.</h5>
            </div>
        );
    }
}

export default Section;
